import axios from "axios";
import React, { ReactElement, useState } from "react";
import { Link } from "react-router-dom";

interface props {
	open: boolean;
	close: () => void; // 함수 타입 정의할 때
}

const ClearTrashcanModal = (props: props): ReactElement => {
	const { open, close } = props;
	const [deleted, setDeleted] = useState(false);

	// const onClickHandler = () => {
	// 	axios
	// 		.get("/logout")
	// 		.then((response) => {
	// 			window.location.replace("/loginForm");
	// 		})
	// 		.catch((err) => {
	// 			console.log(err);
	// 		});
	// };

	const handleClearTrashcanClick = async () => {
		await axios
			.get("/home/trashcan/clearTrashcan")
			.then((res) => {
				console.log(
					"Successfully enter handleClearTrashcanClick in HomeTrashcan :D"
				);
				console.log(res.data);
				setDeleted(true);
				window.history.go(0);
			})
			.catch((err) => {
				console.log(err);
			});
	};

	return (
		<>
			<div className={open ? "bg" : ""} />
			<div className={open ? "modal active" : "modal"}>
				{open ? (
					<div className=" ㅁㄱㄷClearTrashcanModal-area">
						<div className="modal-close">
							<button onClick={close}>
								<img src="/buttons/x.svg" alt=""></img>
							</button>
						</div>
						<hr className="menu-modal-hr" />
						<div className="menu-container">
							<Link to={"/mypage/info"} style={{ textDecoration: "none" }}>
								<div className="menu-element">마이 페이지</div>
							</Link>

							<Link to={"/logout"} style={{ textDecoration: "none" }}>
								<div className="menu-element">로그아웃</div>
							</Link>
						</div>
					</div>
				) : null}
			</div>
		</>
	);
};

export default ClearTrashcanModal;
